...TRES LECHES CAKE! (three-milk cake)
.
Watch out for the moister cake of your whole life. The tres leches cake is a classic Mexican dessert; it is super moist, usually served cold, and it has the right amount of sweetness. It gets its name from the three types of milk used, and honestly, it is a little scary when you see the amount of liquid that it's poured over the straight-from-the-oven cake.
.
Please do not underestimate this cake because of its simplicity. Although it has no filling, it is truly delicious.
I remember that I made it for my boyfriend's birthday bbq 2 years ago and one of his mates said "That's a moist cake!" when he tried it.
.
.
